var wcManageSubscriber = angular.module( "wcManageSubscriber",[]);

wcManageSubscriber.controller( "wcManageSubscriberController", function( $scope ) {

        //For test purpose only
        //sessionStorage.selectedSub = '700900';

        $scope.selectedPatInfo = '';
        $scope.selectedName = ''; 
        $scope.selectedSex = ''; 
        $scope.selectedSS = ''; 
        $scope.selectedDOB = '';

        $scope.confirmChanges = 0;


        $scope.benefits = [
        {bName:"basic"},
        {bName:"extended"},
        {bName:"superior"}
        ];

        $scope.plans = [
        {pCode: "780",pName:"plan 780"},
        {pCode: "790",pName:"plan 790"},
        {pCode: "793",pName:"plan 793"},
        {pCode: "784",pName:"plan 784"},
        {pCode: "785",pName:"plan 785"},
        ];

        $scope.sex = [
        {sCode:"Male"},
        {sCode: "Female"}
        ]


	//Get Subscriber Info
	$scope.getSubInfo = function() { 

	    var subId = $scope.selectedSubscriber;
	    var dq = new DataQuery( 'qcGetSubscriberInfo' );
        dq.setParameters({"subscriberId":subId});
        dq.execute().
    	    done( function() {
    	    	$scope.$apply(function() {
    			    $scope.subInfo = dq.getData().data[0];
    		    });
    	    });
	    return '';
	};


	//Get SubscriberFamily info
	$scope.getPatInfo = function() { 

	    var subId = $scope.selectedSubscriber;
	    var dq = new DataQuery( 'qcGetPatientsInfo' );
        dq.setParameters({"subscriberId":subId});
        dq.execute().
    	    done( function() {
    	    	$scope.$apply(function() {
    			    $scope.patients = dq.getData().data;
    		    });
    	    });
	    return '';
	};

    $scope.chooseMember = function(arg) {

        //alert(arg.rowdata.name + arg.rowdata.sex + arg.rowdata.SS + arg.rowdata.DOB);
        $scope.$apply(function() {
            $scope.selectedName = arg.rowdata.name; 
            $scope.selectedSex = arg.rowdata.sex; 
            $scope.selectedSS = arg.rowdata.SS; 
            $scope.selectedDOB = arg.rowdata.DOB;
        });

        return '';
    };


        //Get Subscribers List
        var dq = new DataQuery( 'qcGetSubscribers' );
        dq.execute().
            done( function() {
    	    	$scope.$apply(function() {
    			    $scope.subscribers = dq.getData().data;
    		    });
    	    });

        //If screen called with a subscriber already set, position the screen on the right subscriber
        if (sessionStorage.selectedSub != ''){
            $scope.selectedSubscriber = sessionStorage.selectedSub;
            sessionStorage.selectedSub = '';
            $scope.getSubInfo();
            }
        else {
            $scope.selectedSubscriber='';            
            }

